import React, { Component } from 'react';
import { Navbar, NavbarBrand } from 'reactstrap';
import Boutique from './components/BoutiqueComponent';
import './App.css';
import { FASHIONS } from './shared/fashions';


class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            fashions: FASHIONS
        };
    }
  render() {
      return (
          <div className="App">
              <Navbar dark color="primary">
              <div className="container">
                  <NavbarBrand href="/">Mode Boutique</NavbarBrand>
              </div>
              </Navbar>
              <Boutique fashions={this.state.fashions} />

          </div>
      );
  }
}

export default App;
